import React, { Component } from 'react';
import "./Test.css"

const GridElement = () => {
    return(<div className={"grid-element"}></div>);
}

export default class Test extends Component {
    render_GridElements(x) {
        let gridelements = [];
        for (let i=0; i < x; i++) {
            gridelements.push(
                GridElement()
            );
        }
        return gridelements;
    }

    render() {
        return(
            <div className={"Test"}>
                <div className={"grid"}>
                    {this.render_GridElements(9)}
                </div>
            </div>
        );
    }
}
